import React, { useEffect, useState } from 'react';
import pic1 from '../images/courses/pic1.jpg';
import pic2 from '../images/courses/pic2.jpg';
import pic3 from '../images/courses/pic3.jpg';
import pic4 from '../images/courses/pic4.jpg';


import axios from 'axios';
const CollegePhotos = ({ subNavId })=> {
  const [loading, setLoading] = useState(true);
  const [subNavData, setSubNavData] = useState(null);
  const [error, setError] = useState(null);
  
    // Fetch data when the component mounts
    useEffect(() => {
      const fetchSubNavData = async () => {
        try {
          const response = await axios.get(`http://10.10.20.9:7071/IIA-Website-1.0.0/subsidenavbar/getbyid/3`);
          setSubNavData(response.data);
        } catch (err) {
          setError(err.message);
        } finally {
          setLoading(false);
        }
      };
  
      fetchSubNavData();
    }, [subNavId]); // Run the effect when subNavId changes


  return (
    <div>
           <div className="content-body">
           <div className="container-fluid">
         <div className="row page-titles mx-0">
        <div className="col-sm-6 p-md-0">
          <div className="welcome-text">
            <h4>OUR PLACED CANDIDATES</h4>
          </div>
        </div>
    <div style={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic1} alt="Candidate 1" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic2} alt="Candidate 2" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic3} alt="Candidate 3" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic4} alt="Candidate 4" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
    </div>
    <div style={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic1} alt="Candidate 1" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic2} alt="Candidate 2" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic3} alt="Candidate 3" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
      <div style={{ flex: '1 1 22%', margin: '10px' }}>
        <img src={pic4} alt="Candidate 4" style={{ width: '100%', borderRadius: '10px' }} />
      </div>
    </div>
    </div>
    </div>
    </div>
    </div>
  )
}

export default CollegePhotos
